import { useNavigate } from "react-router-dom";
import Profile from "./Profiles";
function Checker() {
    const navigate = useNavigate()
    if (Profile.getId() === 0) {
        navigate('/login')
        alert('Você não está logado, faça login para acessar o dashboard')
    }
}

export default Checker;
